import React, { Component } from 'react';
import logo from './logo.svg';
import './App.css';
import Body from './Body.js';

class App extends Component {
  render() {
    return (
      <div className="App">
          <Logo/>
      </div>
    );
  }
}


class LogoText extends Logo {
  render() {
    return (
      <div>
        <p>
          Edit <code>src/App.js</code> and save to reload.
        </p>
      </div>
    )
  }
}

export default App;
